"        Quality of pain",
"       </td>",
"       <td>",
"        Sharp, superficial, burning, tingling",
"       </td>",
"       <td>",
"        Deep ache",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Present at rest",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Effect of walking",
"       </td>",
"       <td>",
"        Pain improves",
"       </td>",
"       <td>",
"        Pain made worse",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pain worse in bed",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Preceded by recent change in glycemic control",
"       </td>",
"       <td>",
"        Sometimes",
"       </td>",
"       <td>",
"        No",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
