var title_f23_17_23837="Ibutilide sotalol AF flutter";
var content_f23_17_23837=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F51703&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F51703&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Ibutilide is more effective than sotalol for acute reversion of atrial tachyarrhythmias",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 407px; height: 252px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Among 281 patients with atrial fibrillation or atrial flutter randomized to intravenous ibutilide or intravenous sotalol, both doses of ibutilide were more effective than sotalol for reverting atrial flutter. Among the patients with atrial fibrillation, only the higher dose of ibutilide was significantly more effective than sotalol for restoring sinus rhythm.",
"    <div class=\"footnotes\">",
"     * p &lt;0.05 compared with sotalol.",
"     <br>",
"      &bull; p &lt;0.05 compared with 1 mg ibutilide.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Vos MA, Golitsyn SR, Stangl K, et al. for the Ibutilide/Sotalol Comparator Study Group, Heart 1998; 79:568.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
